DISEÑAMOS TU LOGOTIPO E IDENTIDAD CORPORATIVA

Diseñamos tu logotipo para que sea una representación fiel de la filosofia y valores de tu empresa o marca.
A día de hoy, donde la comunicación de una empresa cada vez es más importante, el tener un logotipo que represente de forma fiel a tu empresa, se convierte en un instrumento básico para poder tener presencia en cualquier medio.
Para poder diseñar el logotipo que te represente a ti o a tu empresa o a tu marca, es imprescindible contar con tu colaboración. Deberás transmitirnos de forma correcta que quieres comunicar con el, que mensaje quieres enviar y que sensaciones buscas provocar. Juntos le daremos forma.
Una vez tengamos definido el logotipo deberemos desarrollar el resto de la identidad corporativa o marca, normalizando el uso de dicho logotipo y aplicando dichas normas a la creación de la papelería corporativa (tarjetas, sobres, hojas de carta, carpetas) y de la publicidad de la empresa (folletos, carteles, banners, pegatinas, lonas, etc).

